import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';

const useStyles = makeStyles(theme => ({
  button1: {
    marginLeft: 15,
    marginTop: 10,
    widht: 150
  },

  button2: {
    marginLeft: 30,
    marginTop: 10,
    widht: 150,
    backgroundColor:'#007bff',

    '&:hover':{
        backgroundColor: '#0069d9',
        borderColor: '#0062cc',
        boxShadow: 'none',
  }},

  input: {
    display: 'none',
  }

}));




export default function BotoesNovoPost() {

  const classes = useStyles();

  return (
    <div>
      <Button variant="contained" href="#contained-buttons" className={classes.button1}>
        Link
      </Button>
      <input
        accept="image/*"
        className={classes.input}
        id="contained-button-file"
        multiple
        type="file"
      />

            <Link to="/">
                        <Button variant="contained" marginLeft="50" className={classes.button2}>
                            Cancelar
                        </Button>
                    </Link>


    </div>
  );
}
